-- Ampliacion para triggers de replicacion
-- Importante: muy probablemente sea necesario actualizar el JDBC de postgres (ya que hay problemas con el signo $ con la versión actual)
CREATE OR REPLACE FUNCTION replication_insert_in_changelog(clientid integer, orgid integer, created_by integer, tableid integer, record_uid character varying, optype character varying, xmlvalues character varying)
  RETURNS integer AS
$BODY$
DECLARE
repArray varchar;
BEGIN
	-- determinar el replication array
	SELECT INTO repArray replicationArray FROM AD_TableReplication WHERE AD_Table_ID = tableID;

	IF repArray IS NOT NULL AND repArray <> '' THEN
		INSERT INTO ad_changelog_replication (AD_Changelog_Replication_ID, AD_Client_ID, AD_Org_ID, isActive, Created, CreatedBy, Updated, UpdatedBy, AD_Table_ID, recordUID, operationtype, binaryvalue, replicationarray, columnvalues)
		SELECT nextval('seq_ad_changelog_replication'),clientid,orgid,'Y',NOW(),created_by,NOW(),created_by,tableID,record_uid,opType,null,repArray,xmlValues;
	END IF;
	return 0;
END;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE;
  
  
CREATE OR REPLACE FUNCTION replication_xml_append_column(columnid integer, columnvalue character varying)
  RETURNS character varying AS
$BODY$
DECLARE
	newValue varchar;
	nullY varchar;
BEGIN
	nullY := '';
	newValue := columnValue;
	IF newValue IS NULL THEN 
		newValue :='';
		nullY := 'null="Y"';
	END IF;
	
	return '<column id="' || columnID::varchar || '" value="' || newValue || '" ' || nullY || '/>';
END;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE;


CREATE OR REPLACE FUNCTION replication_xml_append_header()
  RETURNS varchar AS
$BODY$
BEGIN
	return '<?xml version="1.0" encoding="UTF-8"?>';
END;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE;

  
