  LANGUAGE 'plpgsql' VOLATILE;


CREATE OR REPLACE FUNCTION replication_xml_append_close_tag()
  RETURNS varchar AS
$BODY$
BEGIN
	return '</columns>';
END;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE;

CREATE OR REPLACE FUNCTION replication_is_valid_table(p_clientid integer, p_tableid integer, p_nochangelog character, p_retrieveUID varchar)
  RETURNS integer AS
$BODY$
DECLARE
result int;
BEGIN
	-- Si p_retrieveUID es nulo entonces no se puede bitacorear
	-- Si noChangelog = 'Y' entonces no hay mas nada que hacer
	IF p_noChangelog = 'Y' OR p_retrieveUID IS NULL OR p_retrieveUID = '' THEN
		RETURN 0;
	END IF;
	
	-- Verificar si la tabla esta en la nomina de replicacion
	-- y si además posee al menos un 1 en alguna posicion)
	SELECT INTO result COUNT(1)
	FROM ad_tablereplication
	WHERE ad_client_id = p_clientID
	AND ad_table_id = p_tableID
	AND position('1' in replicationarray) > 0;

	RETURN result;
END;
$BODY$
  LANGUAGE 'plpgsql' VOLATILE;


